CREATE TABLE cities(city_id BIGINT AUTO_INCREMENT, zip VARCHAR(4) NOT NULL, city VARCHAR(50) NOT NULL, PRIMARY KEY (city_id));
CREATE TABLE citizens(citizen_id BIGINT AUTO_INCREMENT, citizen_name VARCHAR(200) NOT NULL, zip VARCHAR(4) NOT NULL, age INT NOT NULL, email VARCHAR(200), taj VARCHAR(9), number_of_vaccination INT, last_vaccination DATETIME, PRIMARY KEY (citizen_id));
CREATE TABLE vaccinations(vaccination_id BIGINT AUTO_INCREMENT, citizen_id BIGINT NOT NULL, vaccination_date DATETIME NOT NULL, status VARCHAR(10), note VARCHAR(200), vaccination_type VARCHAR(200), PRIMARY KEY (vaccination_id), FOREIGN KEY (citizen_id) REFERENCES citizens (citizen_id));



